import React from "react";
import withContext from "../withContext";

const Banner = props => {
    return(
        <>
            <section class="hero is-primary">
                <div class="hero-body banner">
                    <p class="title">
                    Primary hero
                    </p>
                    <p class="subtitle">
                    Primary subtitle
                    </p>
                </div>
            </section>
        </>
    )
}
export default withContext(Banner);
